// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "@uniswap/v3-core/contracts/interfaces/callback/IUniswapV3FlashCallback.sol";
import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
// import "hardhat/console.sol";

interface IOwner {
    function owner() external view returns (address);
}

contract Bundler is IUniswapV3FlashCallback {
    using Strings for uint;

    address private immutable original;
    address public immutable bundlerManager;
    address internal _callTo;

    modifier onlyBundlerManager() {
        require(
            bundlerManager == msg.sender || IOwner(bundlerManager).owner() == msg.sender,
            "onlyBundlerManager: caller is not the BundlerManager or its owner"
        );
        _;
    }

    modifier onlyCallTo() {
        require(
            _callTo == msg.sender,
            "onlyCallTo: caller is not the _callTo"
        );
        _;
    }

    modifier onlyOriginal() {
        require(
            original == msg.sender,
            "onlyOriginal: caller is not the original"
        );
        _;
    }

    constructor() {
        bundlerManager = msg.sender;
        original = address(this);
    }

    receive() external payable {}


    ////////////////////////////
    ////  executeOperation  ////
    ////////////////////////////

    function executeOperation(
        address wallet,
        bytes calldata data
    ) public onlyBundlerManager {
        _callTo = wallet;
        _doSingleCall(_callTo, 0, data);
        _callTo = address(0);
    }


    function executeOperationReturnChanges(
        address wallet,
        bytes calldata data,
        address[] calldata retTokens
    ) public {
        uint startGasleft = gasleft();

        string memory beforeBalances = "";
        uint8 i;
        for (i = 0; i < retTokens.length; i++) {
            if (retTokens[i] == address(0)) {
                beforeBalances = string.concat(beforeBalances, wallet.balance.toHexString());
            } else {
                beforeBalances = string.concat(beforeBalances, IERC20(retTokens[i]).balanceOf(wallet).toHexString());
            }
        }

        //executeOperation
        uint beforeGasleft = gasleft();
        _callTo = wallet;
        _doSingleCall(_callTo, 0, data);
        _callTo = address(0);
        uint gasUse = beforeGasleft - gasleft();

        string memory afterBalances = "";
        for (i = 0; i < retTokens.length; i++) {
             if (retTokens[i] == address(0)) {
                afterBalances = string.concat(afterBalances, wallet.balance.toHexString());
            } else {
                afterBalances = string.concat(afterBalances, IERC20(retTokens[i]).balanceOf(wallet).toHexString());
            }
        }

        //it must stop, because it's public
        revert(string.concat("TheChanges", beforeBalances, afterBalances, startGasleft.toHexString(), gasUse.toHexString()));
    }


    function bundlerCallback(
        address to,
        uint value,
        bytes calldata data
    ) external onlyCallTo {
        _doSingleCall(to, value, data);
    }


    function bundlerAtomCallback(
        bytes calldata atomCallBytes
    ) external onlyCallTo {
        _doAtomCall(atomCallBytes);
    }


    /**
     * Supported atomCall
     */
    function atomCall(
        bytes calldata atomCallBytes
    ) external onlyBundlerManager {
        _doAtomCall(atomCallBytes);
    }


    /**
     * Supported delegatecall
     */
    function delegateCall(address to, bytes calldata data) external onlyOriginal {
        (bool success, bytes memory result) = to.delegatecall(data);
        if (!success) {
            assembly {
                revert(add(result, 32), mload(result))
            }
        }
    }


    /////////////////////
    ////  flashloan  ////
    /////////////////////

    function executeFlash(
        address pool,
        uint borrowAmount0,
        uint borrowAmount1,
        bytes calldata atomCallBytes
    ) external onlyBundlerManager {
        _callTo = pool;
        // recipient of borrowed amounts
        // amount of token0 requested to borrow
        // amount of token1 requested to borrow
        // need amount 0 and amount1 in callback to pay back pool
        // recipient of flash should be THIS contract
        IUniswapV3Pool(pool).flash(original, borrowAmount0, borrowAmount1, atomCallBytes);
        _callTo = address(0);
    }


    function uniswapV3FlashCallback(
        uint,
        uint,
        bytes calldata atomCallBytes
    ) external override onlyCallTo {
        _doAtomCall(atomCallBytes);
    }


    /////////////////////
    ////  internal   ////
    /////////////////////

    function _doAtomCall(bytes calldata atomCallBytes) internal {
        uint i;
        while (i < atomCallBytes.length) {
            address to = address(uint160(bytes20(atomCallBytes[i:i + 20])));
            uint value = uint(bytes32(atomCallBytes[i + 20:i + 52]));
            uint len = uint(bytes32(atomCallBytes[i + 52:i + 84]));

            _doSingleCall(to, value, atomCallBytes[i + 84:i + 84 + len]);
            i += 84 + len;
        }
    }


    function _doSingleCall(address to, uint value, bytes calldata data) internal {
        (bool success, bytes memory result) = to.call{value: value}(data);
        if (!success) {
            assembly {
                revert(add(result, 32), mload(result))
            }
        }
    }
}

contracts/wallet/BundlerManager.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "./Bundler.sol";
import "./IPublicSocialRecovery.sol";

contract BundlerManager {

    address public owner;
    address public immutable bundler;
    address public publicSocialRecovery;

    event OwnerChanged(address oldOwner, address newOwner);
    event Error(uint8 i);

    modifier onlyOwner() {
        require(
            owner == msg.sender,
            "onlyOwner: caller is not the owner"
        );
        _;
    }

    modifier onlyPublicSocialRecovery() {
        require(
            publicSocialRecovery == msg.sender,
            "onlyOriginal: caller is not the original"
        );
        _;
    }

    constructor() {
        owner = msg.sender;
        bundler = address(new Bundler());
    }

    function bundle(bytes[] calldata dataArr) public onlyOwner returns(uint8 doneCount) {
        for (uint8 i = 0; i < dataArr.length; i++) {
            (bool success, ) = bundler.call{value: 0}(dataArr[i]);
            if (!success) {
                emit Error(i);
            } else {
                doneCount++;
            }
        }
    }

    ////////////////////////////
    ////   SocialRecovery   ////
    ////////////////////////////

    function initSocialRecovery(
        address _publicSocialRecovery,
        address[] calldata guardians,
        uint8 needGuardiansNum
    ) external onlyOwner {
        require(publicSocialRecovery == address(0), "initSocialRecovery: already exist");

        publicSocialRecovery = _publicSocialRecovery;
        IPublicSocialRecovery(publicSocialRecovery).setGroup(
            guardians,
            needGuardiansNum
        );
    }

    function adoptProposal(bytes32 proposal) external onlyPublicSocialRecovery {
        if (uint96(bytes12(proposal)) == 4) {
            _doChangeOwner(address(uint160(uint(proposal))));
        } else {
            revert("adoptProposal: unsupported");
        }
    }

    function changeOwner(address newOwner) external onlyOwner {
        _doChangeOwner(newOwner);
    }

    function _doChangeOwner(address newOwner) internal {
        emit OwnerChanged(owner, newOwner);
        owner = newOwner;
    }
}

